import React, { useEffect, useRef } from "react";



const NaverMap = () => {
    const mapElement = useRef(null);
    // if (!mapElement.current || !naver) return;
    
    // const location = new naver.maps.LatLng(36.32787631122742, 127.42585033518178);
    // const 

    useEffect(() => {
        const {naver} = window;
        if (!mapElement.current || !naver) return;

        const location = new naver.maps.LatLng(36.32787631122742, 127.42585033518178);

        const options = {
            center : location,
            zoom : 16,
            zoomControl : true,
            zommControlOptions: {position : naver.maps.Position.TOP_RIGHT}
        };
        const map = new naver.maps.Map(mapElement.current, options);


        // const mapDiv = document.getElementById('myNaverMap');
        // const map = new window.naver.maps.Map(mapDiv);
    }, [])


    return (
        <div ref="myNaverMap" style={{width:'100%', height:'100%', position:'relative', overflow:'hidden'}}></div>
    )
}

export default NaverMap;
